style.css:
:root {
  -yt-primary-color: #2780e6;
  -yt-secondary-color: #1e63b3;
  -yt-success-color: #43b581;
  -yt-danger-color: #982929;
  -yt-link-color: var(--yt-primary-color);
  -yt-undefined: 0;
  -yt-background-image: url('https://media.discordapp.net/attachments/1130675521924120727/1131017854385393705/Untitled_2.jpg?width=743&height=418');
  -yt-background-shading: 0%;
  -yt-background-position: center;
  -yt-background-size: cover;
  -yt-background-repeat: no-repeat;
  -yt-background-attachment: fixed;
  -yt-background-brightness: 300%;
  -yt-background-contrast: 100%;
  -yt-background-saturation: 100%;
  -yt-background-grayscale: 0%;
  -yt-background-invert: 0%;
  -yt-background-blur: 0px;
  -yt-background-overlay: rgba(0, 0, 0, 0.6);
  -yt-user-popout-image: url('https://clearvision.github.io/images/sapphire.jpg');
  -yt-user-popout-position: center;
  -yt-user-popout-size: cover;
  -yt-user-popout-repeat: no-repeat;
  -yt-user-popout-attachment: fixed;
  -yt-user-popout-brightness: 100%;
  -yt-user-popout-contrast: 100%;
  -yt-user-popout-saturation: 100%;
  -yt-user-popout-grayscale: 0%;
  -yt-user-popout-invert: 0%;
  -yt-user-popout-blur: 3px;
  -yt-user-modal-image: url('https://clearvision.github.io/images/sapphire.jpg');
  -yt-user-modal-position: center;
  -yt-user-modal-size: cover;
  -yt-user-modal-repeat: no-repeat;
  -yt-user-modal-attachment: fixed;
  -yt-user-modal-brightness: 100%;
  -yt-user-modal-contrast: 100%;
  -yt-user-modal-saturation: 100%;
  -yt-user-modal-grayscale: 0%;
  -yt-user-modal-invert: 0%;
  -yt-user-modal-blur: 3px;
  -yt-home-icon: url('https://clearvision.github.io/icons/discord.svg');
  -yt-home-position: center;
  -yt-home-size: 40px;
  -yt-channel-unread: var(--yt-primary-color);
  -yt-channel-color: rgba(255, 255, 255, 0.3);
  -yt-muted-color: rgba(255, 255, 255, 0.1);
  -yt-online-color: #43b581;
  -yt-idle-color: #faa61a;
  -yt-dnd-color: #982929;
  -yt-streaming-color: #593695;
  -yt-offline-color: #808080;
  -yt-main-font: gg sans;
  -yt-code-font: Consolas;
  -yt-channels-width: 220px;
  -yt-members-width: 240px;
  -yt-backdrop-overlay: rgba(0, 0, 0, 0.8);
  -yt-backdrop-image: var(--yt-background-image);
  -yt-backdrop-position: var(--yt-background-position);
  -yt-backdrop-size: var(--yt-background-size);
  -yt-backdrop-repeat: var(--yt-background-repeat);
  -yt-backdrop-attachment: var(--yt-background-attachment);
  -yt-backdrop-brightness: var(--yt-background-brightness);
  -yt-backdrop-contrast: var(--yt-background-contrast);
  -yt-backdrop-saturation: var(--yt-background-saturation);
  -yt-backdrop-invert: var(--yt-background-invert);
  -yt-backdrop-grayscale: var(--yt-background-grayscale);
  -yt-backdrop-sepia: var(--yt-background-sepia);
  -yt-backdrop-blur: var(--yt-background-blur);
  -yt-bd-blue: var(--yt-primary-color);
  -yt-bd-blue-hover: var(--yt-secondary-color);
  -yt-bd-blue-active: var(--yt-secondary-color);
}
